In November 2013 Dr William Lane Craig traveled to the United Kingdom to be a part of the C. S. Lewis Memorial Conference and Service. In this video, world class apologist and philosopher, William Lane Craig is interviewed by UCCF Director, Richard Cunningham, on the life and work of Oxford Scholar CS Lewis.  The interview broadens from C.S. Lewis into discussion of various topics, including:

• the Kalam Cosmological Argument;
• the Trilemma argument and the addition of 'Legend' to the question of whether Jesus is 'Lord, Liar or Lunatic' -- see also 'The Trilemma: Lord, liar or lunatic?';
• what the titles of Son of God and Son of Man tell us about Jesus;
• Lewis' encounter with Elizabeth Anscombe at the Socratic Club debate in 1948 and its consequences (including philosopher Alvin Plantinga's own treatment of the issue under debate -- see Plantinga's talk 'An Evolutionary Argument against Naturalism');
• the use of imagination in apologetics and the role in apologetics of the human longing for something 'more' or 'beyond';
• Lewis' responses to logical positivism and to postmodernism.

Dr Craig also states that in his own ministry he has argued that the existence of God and God's self-revelation in Jesus as shown by his resurrection from the dead are "the twin pillars on which Christianity rests".

UCCF: The Christian Unions is made up of over 200 Christian Unions representing 20,000 Christian students from all sorts of church backgrounds and denominations. We want to give every student in Great Britain an opportunity to hear about Jesus and experience his love and kindness.

